import React from 'react';
import axios from 'axios';
import SeachBar from './SearchBar';
class App extends React.Component{
    async onSearchSubmit(term){
       await axios.get('https://api.unsplash.com/search/photos',{
           params:{query : term},
            headers:{
                Authorization: 'Client-ID X-IwvAH4iDrYZ8dBH1o7TNlvZzNsaPSDPU9qwJ3Ug2Y'
            }
       });
    }
    render(){
        return (
            <div className="ui container" style={{marginTop:'10px', marginBottom:'10px'}}>
                <SeachBar onSubmitting={this.onSearchSubmit}/>
            </div>
            );
    }
    
}

export default App;
